const SERVER_URL = "http://192.168.0.100:8000";  // FastAPI 서버 주소

export async function sendArtworkTarget(artwork) {
  const res = await fetch(`${SERVER_URL}/go_to_art`, {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify(artwork)
  });
  return await res.json();
}
